import ReactDOM from 'react-dom';
import CommentDetails from './CommentDetails'
const App= () =>{
    return (<div className="uiContainer">
    <CommentDetails author="Abhinav Singh"timeAgo="Today at 11:00 AM"/>
    <CommentDetails author="Avinash Singh"timeAgo="Today at 1:00 AM"/>
    <CommentDetails author="Ram Singh"timeAgo="Today at 12:00 AM"/>
    </div>
    );
};
ReactDOM.render(<App/>,document.querySelector('#root'));
